import React from "react";
import { useNavigate } from "react-router-dom";
import Footer from './Footer';
import NavBar from "./Navbar";

function Dashboard() {
  const navigate = useNavigate();

  // Fungsi untuk menavigasi ke halaman Diagnosis
  const handleMulaiIdentifikasi = () => {
    navigate('/diagnosis');
  };

  // Fungsi untuk menavigasi ke Riwayat Diagnosis
  const handleRiwayatDiagnosis = () => {
    navigate('/riwayat');
  };

  return (
    <div>
      <NavBar />
      <div className="container mt-5">
        <h2>Dashboard</h2>
        <p>Selamat datang di Dashboard Anda! Pilih opsi di bawah untuk mulai.</p>
        
        {/* Card Identifikasi Baru */}
        <div className="d-flex justify-content-between mt-4">
          <div className="card p-3" style={{ width: '45%' }}>
            <h5>Identifikasi Baru</h5>
            <p>Mulai identifikasi untuk mendapatkan diagnosis terbaru.</p>
            <button className="btn btn-primary" onClick={handleMulaiIdentifikasi}>Mulai Identifikasi</button>
          </div>
          
          {/* Card Riwayat Diagnosis */}
          <div className="card p-3" style={{ width: '45%' }}>
            <h5>Riwayat Diagnosis</h5>
            <p>Lihat hasil diagnosis sebelumnya yang sudah dilakukan.</p>
            <button className="btn btn-secondary" onClick={handleRiwayatDiagnosis}>Lihat Riwayat</button>
          </div>
        </div>

        {/* Info tambahan atau statistik */}
        <div className="mt-5">
          <h4>Statistik Penggunaan</h4>
          <div className="row">
            <div className="col-6 col-md-3">
              <div className="card p-3">
                <h6>Total Identifikasi</h6>
                <p>12 kali identifikasi dilakukan</p>
              </div>
            </div>
            <div className="col-6 col-md-3">
              <div className="card p-3">
                <h6>Total Diagnosis Positif</h6>
                <p>5 diagnosis positif</p>
              </div>
            </div>
            <div className="col-6 col-md-3">
              <div className="card p-3">
                <h6>Total Diagnosis Negatif</h6>
                <p>7 diagnosis negatif</p>
              </div>
            </div>
            <div className="col-6 col-md-3">
              <div className="card p-3">
                <h6>Diagnosis Pending</h6>
                <p>0 diagnosis yang menunggu</p>
              </div>
            </div>
          </div>
        </div>

      </div>
      <Footer />
    </div>
  );
}

export default Dashboard;
